bool mlex_read(char* s){
	int s_idx = 0;
	int c_idx = mlex_input_map[s[s_idx]];
	int next = start_index, *next_vt = 0;
	while ((c_idx != -1 || mlex_input_map[1] != -1) && next != -1) {
		if (c_idx == -1) {
			c_idx = 0;
		}
		next = mlex_state_metrix[next][c_idx];
		if (next == -1) {
			break;
		}
		next_vt = mlex_state_metrix[next];
		c_idx = mlex_input_map[s[++s_idx]];
	}
	if (s[s_idx] != 0){
		return 0;
	}
	if (next_vt != 0 && next_vt[input_count] == 1)
		return 1;
	else
		return 0;
}
